enum FFEnum { FilterFormat, FormatOnly };

// PresenceEnum Enumeration values:
// Presence         = User has the option to choose FieldPresent or FieldAbsent on FieldPresence controls; Neither is selected by default;
//                    Value fields available for user entry unless FieldAbsent is chosen, in which case values are grayed.
// NoPresence       = User does not have the option of choosing FieldPresent or FieldAbsent on FieldPresence controls, as controls are gray;
//                    Value fields available for user entry.
// PresenceRequired = Either FieldPresent or FieldAbsent must be selected on FieldPresence controls; FieldPresent is the default;
//                    Value fields available for user entry unless FieldAbsent is chosen, in which case values are grayed.
// PresenceOnly     = Either FieldPresent or FieldAbsent must be selected on FieldPresence controls; FieldPresent is the default;
//                    All value fields are grayed and unavailable to the user.
enum PresenceEnum {Presence,NoPresence,PresenceRequired,PresenceOnly};

